import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <>
      <div className="Home">
        <div className="title">
          <h2>
            <Link to="/about">About</Link>
          </h2>
          <h1>PORTFOLIO</h1>
          <h2>
            <Link to="/work">Work</Link>
          </h2>
        </div>
      </div>
      ;
    </>
  );
};

export default Home;
